import logo from './logo.svg';
import './App.css';
import React from 'react'

class App extends React.Component{
  constructor(){
    super()
    this.state={
      prop_1:'one',
      prop_2:'two'
    }
  }
  render(){
    return (
      <div className="App">
        <p>redux example</p>
        <p>{this.state.prop_1}</p>
        <p>{this.state.prop_2}</p>
      </div>
    );
  }

}

export default App;
